ons": [ "Unspecified likelihood.", "Very unlikely.", "Unlikely.", "Possible.", "Likely.", "Very likely." ], "type": "string", "description": "Likelihood of the pornography content.." } } }, "GoogleCloudVideointelligenceV1p3beta1_FaceDetectionAnnotation": { "type": "object", "properties": { "tracks": { "items": { "$ref": "GoogleCloudVideointelligenceV1p3beta1_Track" }, "description": "The face tracks with attributes.", "type": "array" }, "version": { "type": "string", "description": "Feature version." }, "thumbnail": { "type": "string", "format": "byte", "description": "The thumbnail of a person's face." } }, "description": "Face detection annotation.", "id": "GoogleCloudVideointelligenceV1p3beta1_FaceDetectionAnnotation" }, "GoogleCloudVideointelligenceV1p3beta1_LabelFrame": { "id": "GoogleCloudVideointelligenceV1p3beta1_LabelFrame", "type": "object", "properties": { "confidence": { "format": "float", "type": "number", "description": "Confidence that the label is accurate. Range: [0, 1]." }, "timeOffset": { "type": "string", "description": "Time-offset, relative to the beginning of the video, corresponding to the video frame for this location.", "format": "google-duration" } }, "description": "Video frame level annotation results for label detection." }, "GoogleCloudVideointelligenceV1p3beta1_VideoSegment": { "id": "GoogleCloudVideointelligenceV1p3beta1_VideoSegment", "properties": { "endTimeOffset": { "type": "string", "description": "Time-offset, relative to the beginning of the video, corresponding to the end of the segment (inclusive).", "format": "google-duration" }, "startTimeOffset": { "type": "string", "format": "google-duration", "description": "Time-offset, relative to the beginning of the video, corresponding to the start of the segment (inclusive)." } }, "type": "object", "description": "Video segment." }, "GoogleCloudVideointelligenceV1_FaceFrame": { "id": "GoogleCloudVideointelligenceV1_FaceFrame", "properties": { "normalizedBoundingBoxes": { "items": 