ion." }, "segments": { "items": { "$ref": "GoogleCloudVideointelligenceV1p2beta1_LabelSegment" }, "type": "array", "description": "All video segments where a label was detected." }, "entity": { "description": "Detected entity.", "$ref": "GoogleCloudVideointelligenceV1p2beta1_Entity" }, "frames": { "type": "array", "description": "All video frames where a label was detected.", "items": { "$ref": "GoogleCloudVideointelligenceV1p2beta1_LabelFrame" } } }, "id": "GoogleCloudVideointelligenceV1p2beta1_LabelAnnotation", "type": "object" }, "GoogleCloudVideointelligenceV1p1beta1_SpeechContext": { "description": "Provides \"hints\" to the speech recognizer to favor specific words and phrases in the results.", "type": "object", "properties": { "phrases": { "type": "array", "items": { "type": "string" }, "description": "Optional. A list of strings containing words and phrases \"hints\" so that the speech recognition is more likely to recognize them. This can be used to improve the accuracy for specific words and phrases, for example, if specific commands are typically spoken by the user. This can also be used to add additional words to the vocabulary of the recognizer. See [usage limits](https://cloud.google.com/speech/limits#content)." } }, "id": "GoogleCloudVideointelligenceV1p1beta1_SpeechContext" }, "GoogleCloudVideointelligenceV1beta2_TextFrame": { "type": "object", "id": "GoogleCloudVideointelligenceV1beta2_TextFrame", "properties": { "timeOffset": { "type": "string", "description": "Timestamp of this frame.", "format": "google-duration" }, "rotatedBoundingBox": { "description": "Bounding polygon of the detected text for this frame.", "$ref": "GoogleCloudVideointelligenceV1beta2_NormalizedBoundingPoly" } }, "description": "Video frame level annotation results for text annotation (OCR). Contains information regarding timestamp and bounding box locations for the frames containing detected OCR text snippets." }, "GoogleCloudVideointelligenceV1p2beta1_TextFrame": { "properti